import NavBar from "./NavBar";

function Dashboard() {
  const myUser = localStorage.getItem("myUser");
    console.log(myUser);
  return (
    <div>
      {
        myUser!==null?
        <div>
          <h2>welcome{JSON.parse(myUser).name}</h2>
          <h3>Dashboard</h3>
          </div>
          :<h2>Please Login</h2>
      }
      </div>

      

  )

}
export default Dashboard;
